INSERT INTO `qk7ce_overrider` VALUES(371, 'ADD_NAMES_DESC', 'Add the Name of the user in the header of the e-mail.<br />Some Mail Servers don\'t accept names, in that case you have to disable this option.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(372, 'FROM_NAME_DESC', 'Default From Name used in all your Newsletters.<br />You can override this property for each Newsletter you write', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(373, 'FROM_ADDRESS_DESC', 'Default E-mail address used as <b><i>from</i></b> in all your Newsletters', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
