INSERT INTO `qk7ce_overrider` VALUES(375, 'REPLYTO_ADDRESS_DESC', 'Default E-mail address used as <b><i>reply-to</i></b> in all your Newsletters', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(376, 'BOUNCE_ADDRESS_DESC', 'This e-mail address will receive all the automatic responses from your receivers.<br />If you don\'t know what this field is, please leave it empty as this field can block your send process if it\'s not configured properly.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(377, 'MAILER_METHOD_DESC', 'Mailer method used to send your e-mails.<br />We recommend the <b><i>PHP Mail Function</i></b>.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(378, 'ENCODING_FORMAT_DESC', 'Encoding format used for all your Newsletters.<br />We recommend <b><i>8-Bit</i></b>.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(379, 'CHARSET_DESC', 'Charset used for all your Newsletters.<br />We recommend <b><i>UTF-8</i></b>.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(380, 'WORD_WRAPPING_DESC', 'Some servers don\'t allow you to send e-mails with more than xx characters per line.<br />This parameter enables you to set this limitation.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(381, 'HOSTNAME_DESC', 'Sets the host name to use in Message-Id and Received headers and as default HELO string.<br />Leave this field empty if you don\'t know what is it.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(382, 'EMBED_IMAGES_DESC', 'Should AcyMailing embed your pictures inside the Newsletter?<br />If so, the send process will take more time but the recipient won\'t have to download the picture from your website.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(383, 'EMBED_ATTACHMENTS_DESC', 'Should AcyMailing embed your attachments inside the Newsletter?<br />If not, AcyMailing will add a list of attachments with links to your website in order to download them.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(384, 'MULTIPLE_PART_DESC', 'Should AcyMailing send multiple part e-mails?<br />If so, AcyMailing will send the text and the html version in the e-mail so that depending on the recipient, the appropriate version will be opened.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
INSERT INTO `qk7ce_overrider` VALUES(385, 'SENDMAIL_PATH_DESC', 'Path used to call the SendMail function.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_acymailing.ini');
