INSERT INTO `qk7ce_overrider` VALUES(1416, 'COM_FINDER_ADVANCED_TIPS', '<p>Here are a few examples of how you can use the search feature:</p><p>Entering <span class=\"term\">this and that</span> into the search form will return results containing both &quot;this&quot; and &quot;that&quot;.</p><p>Entering <span class=\"term\">this not that</span> into the search form will return results containing &quot;this&quot; and not &quot;that&quot;.</p><p>Entering <span class=\"term\">this or that</span> into the search form will return results containing either &quot;this&quot; or &quot;that&quot;.</p><p>Entering <span class=\"term\">&quot;this and that&quot;</span> (with quotes) into the search form will return results containing the exact phrase &quot;this and that&quot;.</p><p>Search results can also be filtered using a variety of criteria. Select one or more filters below to get started.</p>', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.com_finder.ini');
