INSERT INTO `qk7ce_overrider` VALUES(4128, 'JLIB_RULES_SETTING_NOTES', '1. If you change the setting, it will apply to this and all child groups, components and content. Note that <em>Denied</em> will overrule any inherited setting and also the setting in any child group, component or content. In the case of a setting conflict, <em>Deny</em> will take precedence. <em>Not Set</em> is equivalent to <em>Denied</em> but can be changed in child groups, components and content.<br />2. If you select a new setting, click <em>Save</em> to refresh the calculated settings.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.lib_joomla.ini');
INSERT INTO `qk7ce_overrider` VALUES(4129, 'JLIB_RULES_SETTING_NOTES_ITEM', '1. If you change the setting, it will apply to this item. Note that:<br /><em>Inherited</em> means that the permissions from global configuration, parent group and category will be used.<br /><em>Denied</em> means that no matter what the global configuration, parent group or category settings are, the group being edited can\'t take this action on this item.<br /><em>Allowed</em> means that the group being edited will be able to take this action for this item (but if this is in conflict with the global configuration, parent group or category it will have no impact; a conflict will be indicated by <em>Not Allowed (Locked)</em> under Calculated Settings).<br />2. If you select a new setting, click <em>Save</em> to refresh the calculated settings.', 'C:\\wamp\\www\\framework\\language\\en-GB\\en-GB.lib_joomla.ini');
